import { configureStore } from "@reduxjs/toolkit";

import ordersReducer from "./Orders";
import mealsReducer from "./Meals";
import tablesReducer from './Tables';

export default configureStore({
  reducer: {
    orders: ordersReducer,
    meals: mealsReducer,
    tables: tables
  },
});
